class SocketIOProxyNS(socketio.AsyncNamespace):
	def __init__(self, server_url, logger= None):
		socketio.AsyncNamespace.__init__(self)
		self.sessions = {}
		self.name = '[SocketIOProxy]'
		self.logger= logger
		self.server_url = server_url


	async def handle_client_out(self, ws, sid):
		while True:
			try:
				data = await ws.recv()
				await self.send(data, room = sid)

			except Exception as e:
				self.logger.exception('%s Client comms error! ' % self.name)
				return

	async def on_connect(self, sid, environ):
		self.logger.info('%s Client connected! ' % self.name)
		self.logger.debug('%s Cnnecting to server!' %  self.name)
		try:
			ws = await websockets.connect(self.server_url)
		except Exception as e:
			self.logger.exception('%s Error connecting to server!', self.name)

		self.logger.debug('%s Starting client hadnlers!' % self.name)
		self.sessions[sid] = ws
		asyncio.ensure_future(self.handle_client_out(ws, sid))

	async def on_message(self, sid, data):
		self.logger.debug('%s Client message in!' % self.name)
		await self.sessions[sid].send(data)

	async def on_disconnect(self, sid):
		print('disconnect ', sid)

class SocketIOProxy:
	def __init__(self, host, port, server_url, logger = None):
		self.listen_ip = host
		self.listen_port = port
		self.logger = logger
		self.name = '[SocketIOProxy]'
		self.server_url = server_url

		self.sio = socketio.AsyncServer()
		self.app = web.Application()
		self.sio.attach(self.app)
	
		self.static_html = html_data

	async def index(self, request):
		"""Serve the client-side application."""
		return web.Response(text=self.static_html, content_type='text/html')

	async def serve_jquery(self, request):
		"""Serve the client-side application."""
		return web.Response(text=base64.b64decode(jquery_2_1_4_min_js).decode(), content_type='application/javascript')

	async def serve_socketio(self, request):
		"""Serve the client-side application."""
		return web.Response(text=base64.b64decode(socket_io_slim_js).decode(), content_type='application/javascript')

	async def run(self):
		#app.router.add_static('/', 'static')
		self.app.router.add_get('/', self.index)
		self.app.router.add_get('/jquery-2.1.4.min.js', self.serve_jquery)
		self.app.router.add_get('/socket.io.slim.js', self.serve_socketio)
		self.sio.register_namespace(SocketIOProxyNS(self.server_url, self.logger))

		runner = web.AppRunner(self.app)
		await runner.setup()
		site = web.TCPSite(runner, self.listen_ip, self.listen_port)
		await site.start()